import React from 'react'
import './userStyle.css'

function UserProfile({history}) {

    let user = JSON.stringify(history.location.state.values.name)

    user = user.replace(/['"]+/g, '');
    console.log(user);

    return (
        <div class="userStyle">
            <div>
                <h3>Account</h3>
            </div>
            Hi <b>{user}</b>, <br/>
            we are glad to see you in our store! <br />
            Let's do some shopping!
        </div>
    )
}

export default UserProfile
